import { baseURL } from "./OpenAI";
import React from "react";
import axios from "axios";

class OpenAINLP extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            urlBase: baseURL,
            petNames: [],
            petSpecie: '',
        };
    }

    GetPetNames(specieInput) {
        this.state.petSpecie = specieInput;
        console.log("Submitted: " + specieInput);
        console.log("Specie: " + this.state.petSpecie);

        console.log(this.state.urlBase + "nlp-pet-name/specie/" + this.state.petSpecie);
        axios
         .post(this.state.urlBase + "nlp-pet-name/specie/" + this.state.petSpecie)
         .then((response) => {
            this.state.petNames = response.data.names;
            this.state.petSpecie = response.data.specie;
            console.log(this.state.petNames);
         })
         .catch((error) => {
            console.log(error);
         });

         return this.state.petNames;
    }
}
export default OpenAINLP;

